import React from "react";

function Card(props) {
  return (
    <div className="card">
      <div className="top">
        <h2 className="name">{props.name}</h2>
        <img
          className="circle-img"
          src="https://im.rediff.com/sports/2018/apr/10hima.jpg?w=300&h=400"
          alt="avatar_img"
        />
      </div>
      <div className="bottom">
        <p className="phone">+123 456 789</p>
        <p className="email">himadas@india.com</p>
      </div>
    </div>
  );
}

export default Card;
